    of invoices from D. Browne and Anzalone Liszt that arrived between the time the
    original report was submitted on 23 Oct 08, but before the amended report was
    submitted on 21 Dec 08. The date we used to report these debts in our software
    reporting system was the date the invoice was created by the vendor, instead of
    the date the campaign received the invoice.  In future we will use the date we
